using Memory.Structs;using UnityEngine;namespace Core.Management{    public static partial class Main    {        public static void SetMemoryResult(MemoryGameResult result)        {            Database.SetDatabaseString(DatabaseKeys.LastGameResultDatabaseKey, JsonUtility.ToJson(result));            Database.SetDatabaseString(DatabaseKeys.LastGameTypeDatabaseKey, GameType.MEMORY.ToString());            SetGameTypeProgress(GameType.MEMORY, result.Level + 1);        }    }}